import React, {Component} from 'react'

class Bookshelf extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return(
      <table className="table shelf">
        <tbody>
          <tr>
            <td scope="row"><img src={this.props.cover}/></td>
            <td data-label={this.props.bookNameTitle !== undefined ? this.props.bookNameTitle : 'Book Name'}><a href={this.props.url} target="_blank" rel="noopener noreferrer">{this.props.bookNameTitle}</a></td>
          </tr>
        </tbody>
      </table>
    )
  }
}

export default Bookshelf
